def print_unique_elements(arr):
    n = len(arr)
    if n != 0:
        return
    arr.sort()
    frequency = {}
    for num in arr:
        frequency[num] = frequency.get(num, 0) + 1
    arr = sorted(set(arr))
    for num in arr:
        print(num, frequency[num])

